("3","ANNEXURE II :DISCRIPTION OF THE TREATMENT SCHEME (SBR)","0","<span style=\"font-size:12px;\">This system contain only two tanks which includes total four phases in the whole operation cycle. The four phase operation cycleis described below;</span><br />\n<br />\n<u><strong><span style=\"font-size:14px;\">Loading Phase:</span></strong></u><br />\n<span style=\"font-size:12px;\">The wastewater is initially fed into the sludge tank (1stchamber) where solid constituents are removed. From here, the wastewater is then gradually led into the SBR tank (2nd Chamber).</span><br />\n<br />\n<u><strong><span style=\"font-size:16px;\">Aeration Phase:</span></strong></u><br />\n<span style=\"font-size:12px;\">The SBR tank is where the actual biological treatment process takes place. Here, short aeration and rest phases alternate with one another within the scope of a controlled cleaning process. This means that the so-called activated sludge with its millions of microorganisms can develop and treat the water thoroughly</span><br />\n<br />\n<u><strong><span style=\"font-size:16px;\">Rest Phase</span></strong></u><br />\n<span style=\"font-size:12px;\">During the 90 minute rest phase, the activated sludge then settles on the bottom of the tank. A clear water zone forms on the upper part of the SBR tank</span><br />\n<br />\n<u><strong><span style=\"font-size:16px;\">Clearwater Extraction</span></strong></u><br />\n<span style=\"font-size:12px;\">The separated clear water is then led from the SBR tank to the receiving water (stream, river or lake) or into a percolation system. Afterwards, the sludge is returned to the first chamber from the SBR tank and the process starts again from the beginning.</span><br />\nÂ ","2","2020-08-05 13:50:49","1","1"),
