\n			<td width=\"468\">\n			<p><span style=\"font-size:12px;\"><100mg/l</span></p>\n			</td>\n		</tr>\n		<tr height=\"14\">\n			<td height=\"14\" width=\"249\">\n			<p><span style=\"font-size:12px;\">BOD</span></p>\n			</td>\n			<td width=\"468\">\n			<p><span style=\"font-size:12px;\"><30mg/l</span></p>\n			</td>\n		</tr>\n		<tr height=\"14\">\n			<td height=\"14\" width=\"249\">\n			<p><span style=\"font-size:12px;\">TSS</span></p>\n			</td>\n			<td width=\"468\">\n			<p><span style=\"font-size:12px;\"><10mg/l</span></p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<ul>\n	<li>Â <span style=\"font-size:12px;\">The quality and quantity of treated water will be based on the raw/feed water quality and quantity. Any change in raw/feed water quality and/or quantity, it will reflect in the treated water quality and/or quantity.</span></li>\n	<li><span style=\"font-size:12px;\">The treated sewage can be utilized for gardening, horticulture and/or irrigation purpose.</span></li>\n</ul>\n<span style=\"font-size:18px;\"><strong>ABOUT THE TECHNOLOGY</strong></span><br />\nEnviron is the pioneer in sewage treatment systems that are fully automatic, efficient and meet the treatment standards whichare higher than the statutory requirements. Our treatment systems have won the confidence of many clients and every client has been testimonial to the plant performance. The choice of the electro-mechanical equipment and the meticulous design set us ahead in the market for high quality sewage treatment systems.\n<ul>\n	<li>ïƒ˜ Fully automatic sewage treatment systems by Environ can be installed and retrofitted in the plastic or concrete container at any time.</li>\n	<li>ïƒ˜ Fully biological small wastewater treatment plant based on the SBR principle.</li>\n	<li>ïƒ˜ Single or multiple container models from 1 KLD to 500 KLD.</li>\n	<li>ïƒ˜ Energy-efficient due to fine-bubble pressure diffusion and ventilation.</li>\n	<li>ïƒ˜ Due to the compact design, Environ saves large space which is advantageous to the Real Estate Developers and promoters as more space will be available for construction, recreation and other developments.</li>\n	<li>ïƒ˜ No need for centralized plumbing as each villa can have its own STP.</li>\n	<li>ïƒ˜ Reduces operation and maintenance burden/costs for associations and Reduces electricity costs to almost 75%.</li>\n	<li>ïƒ˜ No need for a full time service person to maintain sewage tanks.</li>\n	<li>ïƒ˜ Need not evacuate sludge on a frequent mode, can be done once in a year or more.</li>\n	<li>ïƒ˜ Need not have a large room for sewage treatment plant; this can be fitted within a small underground space.</li>\n	<li>ïƒ˜ Automated maintenance system with 24/7 dashboard links to CPU, smart phones, with email and message (sms) indications.</li>\n	<li>ïƒ˜ Any emergency operations can be done through internet or mobile phone. User controls given to each users including operations or just view only.</li>\n	<li>ïƒ˜ Intelligent system with auto sleeps and holiday mode when less inflow, ideal for development where there is lesser number of people during weekdays.</li>\n	<li>ïƒ˜ Water can be reused for gardening purpose, with almost zero smell, further the water can be filtered for toilet reuse with additional simple filter units.</li>\n</ul>\n","2","2020-08-05 13:50:47","1","1"),
