("7","ENVIRONMENT CLARANCE CATAGORY (B)","0","<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n	<tbody>\n		<tr>\n			<td valign=\"top\" width=\"31\">\n			<p>1.</p>\n			</td>\n			<td valign=\"top\" width=\"545\">\n			<p>Application & get the TOR</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\" width=\"31\">\n			<p>Â </p>\n			</td>\n			<td valign=\"top\" width=\"545\">\n			<p>a)Â Â Â Â Â  Generate online login ID for application of EC & Prepare Form I with required documents for online submission</p>\n\n			<p>b)Â Â Â Â Â  Prepare related documents and submit online and get it accepted by the SEIAA - State pollution Control Board along with the</p>\n\n			<p>c)Â Â Â Â Â Â  quarries raised of the same & Submit the physical Copy of TOR application to SEIAA-GPCB, Gandhinagar</p>\n\n			<p>d)Â Â Â Â Â  Presentation in State Pollution Control Board on behalf of your company to get the TOR & Get the TOR copy</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\" width=\"31\">\n			<p>2</p>\n			</td>\n			<td valign=\"top\" width=\"545\">\n			<p>Preparation of Draft EIA report for Stage(3)</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\" width=\"31\">\n			<p>Â </p>\n			</td>\n			<td valign=\"top\" width=\"545\">\n			<p>1. Technical data collection as per check list based on TOR provided at different stages & its study.</p>\n\n			<p>2. Â Primary data collection for baseline study</p>\n\n			<p>a)Â Â Â Â Â  Ambient Air Quality Survey: At different locations in the project impact area for the parameters like PM2.5, PM10, SO2, NOX, CO (As per TOR, CPCB & NAAQM standards, 2009). Maximum 2 locations in upwind side, more in downwind side/impact Zone.</p>\n\n			<p>b)Â Â Â Â Â  Surface & subsurface Water Quality Survey: Once in a study period from different location for the Physical, Chemical & biological parameters and heavy metals.</p>\n\n			<p>c)Â Â Â Â Â Â  Soil Survey: Once in a study period at different location for the parameters like Particle size Distribution, Texture, pH, Electrical Conductivity, Alkali metals, Permeability, WHC, Porosity, etc.</p>\n\n			<p>d)Â Â Â Â Â  Â Noise Survey: Hourly equivalent Noise levels monitoring once in a study period at different locations.</p>\n\n			<p>e)Â Â Â Â Â  Meteorological Survey: 1 hourly continuous from one site in the project impact area for the parameters like Temp., Relative Humidity, Rain Fall, Cloud Cover, Wind Speed, and Wind Direction.</p>\n\n			<p>f)Â Â Â Â Â Â  Biological Environment (Terrestrial): Once in a study period Within project impact area for the collection of Vegetation-species list, economic importance, forest produce, medicinal value, Fauna, Avi Fauna, Rare and endangered species,</p>\n\n			<p>Sanctuaries, National Park / Biosphere reserve, Migratory routes.</p>\n\n			<p>g)Â Â Â Â Â  Socio-Economic status: Once in a study period within study area for the parameters like Demographic structure, infrastructure resource base, economic resource base, health status: Morbidity pattern, cultural & aesthetic attributes, etc.</p>\n\n			<p>3. Secondary data collection:</p>\n\n			<p>a)Â Â Â Â Â  Land use land cover map</p>\n\n			<p>b)Â Â Â Â Â  Â Meteorological data like Temp., Rainfall, Humidity cloud cover, wind speed, wind direction stability, mixing height</p>\n\n			<p>c)Â Â Â Â Â Â  Socio - Economic Data Collection like Demographic structure, infrastructure resource base, economic resource base, health status: Morbidity pattern, cultural & aesthetic attributes</p>\n\n			<p>d)Â Â Â Â Â  Biological Environment (Terrestrial) like List common flora & fauna found in the region with schedule</p>\n\n			<p>e)Â Â Â Â Â  Data of Natural Disaster like History, zoning, map, for Seismic, Flood, Cyclone, Landslide, etc. hazards.</p>\n\n			<p>f)Â Â Â Â Â Â  Physical & Chemical properties of raw material like Specific MSDS, Characterization of materials, Raw material Analysis report for trace elements or as per TOR collected from client.</p>\n\n			<p>4. Identification, prediction and evaluation of impacts on environment during construction & operation phase.</p>\n\n			<p>5. Â Preparation of Environmental Management Plan in coordination with client.</p>\n\n			<p>6. Â Risk Assessment & disaster management study.</p>\n\n			<p>7. Â Preparation of EIA report and preparation of executive summary in English.</p>\n\n			<p>a)Â Â Â Â Â  Â Submission of final EIA Report.</p>\n\n			<p>b)Â Â Â Â Â  ii) Follow up regarding EC meeting.</p>\n\n			<p>c)Â Â Â Â Â Â  Preparation of Final EC presentation & to attend meeting.</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n","2","2020-08-05 13:50:40","1","1"),
("8","ENVIRONMENT CLEARANCE ( CATAGORY A)","0","<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\">\n	<tbody>\n		<tr>\n			<td valign=\"top\" width=\"638\">\n			<p><b>Scope of Work</b></p>\n\n			<p><b>Â </b></p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\" width=\"638\">\n			<p><b>A)Â Â  </b><b>Preparation of TOR application i.e. Form â€“ I & PFR</b></p>\n\n			<p>a)Â Â Â Â Â  Site visit and review/understanding of data on water balance, waste water generation, water consumption, ETP details, APCM details, hazardous waste details, manufacturing process, etc.</p>\n\n			<p>b)Â Â Â Â Â  Data collection from you and preparation of TOR application i. e. Form â€“ I & PFR.</p>\n\n			<p>c)Â Â Â Â Â Â  Online TOR application uploaded and follow up for the same at MoEF&CC.</p>\n\n			<p>d)Â Â Â Â Â  Preparation of TOR presentation as per MoEF&CC format and present for the same against MoEF&CC for getting TOR.</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\" width=\"638\">\n			<p><b>B)Â Â  </b><b>Primary Data Collection</b></p>\n\n			<p><b>a)Â Â Â Â Â  </b><b>Meteorological Survey:</b> Meteorological data like temperature, wind speed, wind direction, relative humidity etc on hourly basis for the three month will be collected and utilized for EIA study purpose. Interpretation of measured data like daily maximum and minimum temperature, average temperature in day, preparation of wind rose diagram to identify the predominant wind direction and wind speed etc. Collection of data from Indian Metrological Department (IMD) also.</p>\n\n			<p><b>b)Â Â Â  </b><b>Land Use Pattern:</b> Satellite imaginary picture from the Space Application Centern for the study area will be obtained.</p>\n\n			<p><b>c)Â Â Â Â  </b><b>Mathematical Modeling:</b> Running the model ISCST-3 and plotting the isopleths for identifying the ground level concentration of emissions to be generated from the proposed project.</p>\n\n			<p><b>d)Â Â Â  </b><b>Survey of India Map:</b> Survey of India map will be obtained from the relevant department.</p>\n\n			<p><b>e)Â Â Â  </b><b>Geology:</b> Geological data will be collected if required from the Geological Survey of India.</p>\n\n			<p><b>f)Â Â Â Â  </b><b>Socio Economic Data:</b> Socio Economic Data will be collected during the monitoring period for the study area.</p>\n\n			<p><b>g)Â Â Â  </b><b>Traffic Study:</b> Traffic study will be carried out during the study period for the traffic density analysis with reference to the transportaion and its impact on existing traffic scenario.</p>\n\n			<p><b>Â </b></p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\" width=\"638\">\n			<p><b>C)Â Â  </b><b>Baseline Environmental Studies</b></p>\n\n			<p><b>a)Â Â Â Â Â  </b><b>Ambinet Air Environment: </b>Collection of Ambient Air samples and analysis as per the CPCB guidlines for the Parameters like PM<sub>10</sub>, PM<sub>2.5</sub>, SO<sub>2</sub> and NOx within the study area.</p>\n\n			<p><b>b)Â Â Â  </b><b>Water Environment:</b></p>\n\n			<p>Collection of surface and ground water samples within the study area and analysed the same.</p>\n\n			<p>Assessment of ground water quality from available wells.</p>\n\n			<p>Study of ground water with respect to depth of water table.</p>\n\n			<p>Secondary data collection on hydro-geological features & aquifer characteristics near exploration sites and depth & variation of water table, irrigation water characteristics within the study area, if required.</p>\n\n			<p><b>c)Â Â Â Â  </b><b>Noise Environment: </b>Noise Survey will be carried out for day time as well as night time within the study area as per the MOEF guidelines.</p>\n\n			<p><b>d)Â Â Â  </b><b>Soil Characteristics:</b> Collection of soil sample from the study area as per the CPCB guidelines and analyzed for major physical and chemical parameters.</p>\n\n			<p><b>e)Â Â Â  </b><b>Flora & Fauna:</b></p>\n\n			<p>Collection of available information on major flora and fauna including rare and endangered species, ecologically sensitive areas in the study area. Collection of information on micro - fauna communities, etc.</p>\n\n			<p>Assessment including identification of rare, endangered flora and fauna in study area. Assessment of likely changes on flora and fauna due to the project and related activities.</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\" width=\"638\">\n			<p><b>D)Â Â Â Â Â Â  </b><b>Environmental Impact Assessment report and Environmental Management Plan</b></p>\n\n			<p>Rapid Environmental Impact Assessment report will be prepared.</p>\n\n			<p>Material balance, water balance, available resources for proposed project will be studied.</p>\n\n			<p>From project decription and Baseline Environmental study, we will identify the various activities, impacts on various environmental attributes and mitigation measures during construction and operation phase.</p>\n\n			<p>Environmental Management Plan will be prepared and incorporated in the EIA report.</p>\n\n			<p>Post project monitoring plan willÂ  be provided and incorporated in the EIA report.</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\" width=\"638\">\n			<p><b>E)Â  </b><b>Risk Assessment & Disaster Management Plan </b></p>\n\n			<p>Risk assessment will be conducted based on all the risks and hazards associated with the proposed project including prediction of the worst-case scenario and maximum credible accident scenarios. The worst-case scenario will take in to the account the maximum inventory of storage at site at any point in time. Consequence analysis will be carried out using software and the risk contours will be plotted on the plant layout map clearly showing which of the facilities would be affected in case of accidents taking place. Based on the same, proposed safeguard measures including On-site/off-site Emergency Plan will be provided.</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\" width=\"638\">\n			<p><b>F)Â Â Â  </b><b>EnvironmentalÂ  Clearance (EC) </b></p>\n\n			<p>vÂ Â Â  EIA report will be submitted online for the grant of Environmental Clearance. EC presentation will be prepared by us and presented in front of the MoEF&CC, New Delhi. We shall remain present during the meeting/presentation invited by the MoEF&CC, New Delhi to answer Environment related Technical queries raised during the presentation.</p>\n			</td>\n		</tr>\n		<tr>\n			<td valign=\"top\" width=\"638\">\n			<p><b>Specific Conditions</b></p>\n\n			<p>a)Â Â Â Â Â  Any government Liasioning shall be borne by client.</p>\n\n			<p>b)Â Â Â Â Â  This offer is only for technical services and does not include liasioning charges, if any.</p>\n\n			<p>c)Â Â Â Â Â Â  This offer is only for the Environment Clearance and does not include any other government/private application for this project. Preparation of application other than Environment Clearance shall be charged extra.</p>\n\n			<p>d)Â Â Â Â Â  Processing fees or any government fees shall be borne by the Client.</p>\n\n			<p>e)Â Â Â Â Â  Charges for to and fro transportation, lodging and boarding at MoEF&CC, New Delhi for our team shall be borne by the client.</p>\n\n			<p>f)Â Â Â Â Â Â  Certified copy of Compliance report for EC/CC&A Conditions given by MoEF&CC for the existing EC/CC&A shall be provided by the client.</p>\n\n			<p>g)Â Â Â Â Â  The client shall give the approved layout plan with green belt, fire hydrant layout, separate entry and exit gate, production capacity of the project and all the required maps etc.</p>\n\n			<p>h)Â Â Â Â Â  A Director / Vice President / Senior Manager from your organization shall accompany us at the time of representation at various places, if required.</p>\n\n			<p>i)Â Â Â Â Â Â Â  This offer does not include any charges for preparation of Comprehensive EIA report.</p>\n\n			<p>j)Â Â Â Â Â Â Â  Total expenses of Public Consultation is in client scope. We shall prepare only Public Consultation presentation and Executive Summary in English. We shall only guide to the client during whole public consultation process.</p>\n\n			<p>k)Â Â Â Â Â  We need work order before starting the work as per requirement of ISO 9001:2008.</p>\n\n			<p>l)Â Â Â Â Â Â Â  Bill shall be raised on periodic basis and payment shall be made to us within 15 days.</p>\n\n			<p>m)Â Â Â  Payment shall be made by e-payment or at-par cheque or demand draft only.</p>\n\n			<p>n)Â Â Â Â Â  We shall not be responsible for delay in project due to natural calamities or unforeseen incidents.</p>\n\n			<p><b>Â </b></p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n","2","2020-08-05 13:50:37","1","1");




